package groupProjectFiles;

public class Date {
	
	private int Year;
	private int Month;
	private int Day;
	
	public Date(int year, int month, int day) {
		super();
		Year = year;
		Month = month;
		Day = day;
	}
	
	public void Date1(int year2, int month2, int day2) {
		// TODO Auto-generated constructor stub
		Year = year2;
		Month = month2;
		Day = day2;
	}

	public int getYear() {
		return Year;
	}
	
	public void setYear(int year) {
		Year = year;
	}
	
	public int getMonth() {
		return Month;
	}
	
	public void setMonth(int month) {
		Month = month;
	}
	
	public int getDay() {
		return Day;
	}
	
	public void setDay(int day) {
		Day = day;
	}
	
		

}
